using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEditor;

[CustomEditor(typeof(ItemDatabase))]
public class ItemDatabaseEditor : Editor {

    private ItemDatabase database { get { return target as ItemDatabase; } }

    public override void OnInspectorGUI()
    {
        base.OnInspectorGUI();
        if (GUILayout.Button("Find Item Types"))
        {
            if(database.types == null)
                database.types = new List<ItemType>();
            database.types.Clear();
            string[] items = AssetDatabase.FindAssets("t:ItemType");
            foreach (string z in items)
            {
                ItemType itm = (ItemType)AssetDatabase.LoadAssetAtPath(AssetDatabase.GUIDToAssetPath(z), typeof(ItemType));
                if (!database.types.Contains(itm))
                    database.types.Add(itm);
            }
        }
    }


    private static string icon = "";

    public override Texture2D RenderStaticPreview(string assetPath, Object[] subAssets, int width, int height)
    {
        return Base64ToTexture(icon);
    }

    private static Texture2D Base64ToTexture(string base64)
    {
        Texture2D t = new Texture2D(1, 1)
        {
            hideFlags = HideFlags.HideAndDontSave
        };
        t.LoadImage(System.Convert.FromBase64String(base64));
        return t;
    }
}
